","keccak256":"0x562431546443640c950a15ccce0cffedeced3e414c41cc2758bf489f4525d1df","license":"GPL-2.0"},"contracts/core/UserPositions.sol":{"content":"// SPDX-License-Identifier: GPL-2.0
pragma solidity 0.8.4;

import "@openzeppelin/contracts-upgradeable/proxy/utils/Initializable.sol";
import "@openzeppelin/contracts-upgradeable/token/ERC20/extensions/IERC20MetadataUpgradeable.sol";
import "@openzeppelin/contracts-upgradeable/token/ERC20/utils/SafeERC20Upgradeable.sol";

import "../interfaces/IIntegrationMap.sol";
import "../interfaces/IBiosEmitter.sol";
import "../interfaces/IEtherRewards.sol";
import "../interfaces/IUserPositions.sol";
import "../interfaces/IStrategyMap.sol";
import "../interfaces/IStrategy1155.sol";
import "../interfaces/ISwapManager.sol";
import "../interfaces/ISyntheticERC20.sol";
import "../interfaces/ISyntheticMap.sol";
import "../interfaces/IBiosEmitter.sol";

import "./Controlled.sol";
import "./ModuleMapConsumer.sol";

/// @title User Positions
/// @notice Allows users to deposit/withdraw erc20 tokens
contract UserPositions is Initializable, ModuleMapConsumer, Controlled, IUserPositions {
    using SafeERC20Upgradeable for IERC20MetadataUpgradeable;

    uint32 constant BIOS_STRATEGY_1155 = 0;

    /// @dev This is deprecated - now live in BiosRewards.sol
    uint32 private _biosRewardsDuration;

    // token => amount hold by kernel and _strategies
    mapping(address => uint256) private _totalSupply;

    // token => user => available to enter amount
    mapping(address => mapping(address => uint256)) private _balances;

    /// @dev |-***-| Deprecated after tokenization |-***-|
    /// @dev Use IStrategy1155.balanceOfBatch(user, _strategies[]) instead
    mapping(address => mapping(address => uint256)) private _deployedBalances;

    /// @dev |-***-| Deprecated after tokenization |-***-|
    /// @dev Use IStrategy1155.balanceOfBatch(user, _strategies[]) instead
    mapping(address => mapping(uint256 => mapping(address => uint256))) private _userStrategyBalances;

    // Token address => User address => Balance of tokens a user has from interconnecting from other chains
    mapping(address => mapping(address => uint256)) private _interconnectBalances;

    bool public paused;

    /// @param controllers_ The addresses of the controlling contracts
    /// @param moduleMap_ Address of the Module Map
    function initialize(address[] memory controllers_, address moduleMap_) external initializer {
        __Controlled_init(controllers_, moduleMap_);
    }

    function pause() external onlyOwner {
        paused = true;
        emit Pause(true);
    }

    function unpause() external onlyOwner {
        paused = false;
        emit Pause(false);
    }

    modifier whenNotPaused() {
        require(!paused, "contracts are paused");
        _;
    }

    function airdrop(
        address token,
        address[] calldata users,
        uint256[] calldata amounts
    ) external onlyOwner {
        uint256 length = users.length;
        require(length == amounts.length, "airdrop: mismatch");
        require(
            IIntegrationMap(moduleMap.getModuleAddress(Modules.IntegrationMap)).getTokenAcceptingDeposits(token),
            "UserPositions::deposit: This token is not accepting deposits"
        );
        address[] memory tokenParam = new address[](1);
        tokenParam[0] = token;
        uint256[] memory amountParam = new uint256[](1);
        for (uint256 i; i < length; ++i) {
            amountParam[0] = amounts[i];
            _deposit(users[i], tokenParam, amountParam, 0, true);
        }
    }

    /**
     *
     *
     *
     * user cycle
     *
     *
     *
     **/

    function deposit(
        address depositor,
        address[] memory tokens,
        uint256[] memory amounts,
        uint256 ethAmount,
        bool migration
    ) external override onlyController whenNotPaused {
        require(depositor != address(0), "bad address");
        _deposit(depositor, tokens, amounts, ethAmount, migration);
    }

    function enterStrategy(uint256 strategyId, uint256 amount) external override whenNotPaused {
        require(amount > 0, "enter amount must be greater than zero");
        require(strategyId > 0, "invalid strategy");

        _enterStrategy(strategyId, msg.sender, amount);
        address underlying = getUnderlying(strategyId);

        uint256 strategiesDebtPayout = IStrategyMap(moduleMap.getModuleAddress(Modules.StrategyMap)).increaseStrategy(
            strategyId,
            underlying,
            amount
        );

        if (strategiesDebtPayout > 0) {
            address syntheticERC20 = ISyntheticMap(moduleMap.getModuleAddress(Modules.SyntheticMap))
                .underlyingToSynthetic(underlying);

            ISyntheticERC20(syntheticERC20).increaseRedemptionOfSynthetic(strategiesDebtPayout);
        }
    }

    function claimEthRewards(address _recipient, uint256[] calldata _strategies)
        external
        override
        onlyController
        whenNotPaused
        returns (uint256 ethClaimed)
    {
        require(_recipient != address(0), "bad address");
        ethClaimed = _claimEthRewards(_recipient, _strategies);
    }

    function exitStrategy(uint256 strategyId, uint256 _amount) external override whenNotPaused {
        require(_amount > 0, "exit amount must be greater than zero");
        require(strategyId > 0, "invalid strategy");
        _exitStrategy(strategyId, msg.sender, _amount);
        IStrategyMap(moduleMap.getModuleAddress(Modules.StrategyMap)).decreaseStrategy(strategyId, _amount);
    }

    function withdrawAllAndClaim(
        address recipient,
        address[] calldata tokens,
        uint256[] calldata strategies,
        bool withdrawWethAsEth
    ) external override onlyController returns (WithdrawAllAndClaimResponse memory _withdrawAllAndClaimResponse) {
        require(recipient != address(0), "bad address");

        IIntegrationMap integrationMap = IIntegrationMap(moduleMap.getModuleAddress(Modules.IntegrationMap));
        address biosAddress = integrationMap.getBiosTokenAddress();
        address biosEmitterAddress = moduleMap.getModuleAddress(Modules.BiosEmitter);

        _withdrawAllAndClaimResponse = WithdrawAllAndClaimResponse({
            tokenAmounts: new uint256[](tokens.length),
            ethWithdrawn: 0,
            ethClaimed: 0,
            biosClaimed: 0
        });

        /// @notice `BiosEmitter.harvest(...)` has to be called before `UserPosition._withdraw(...)`, because BiosEmitter relies on the user balance state reported by the UserPositions contract.
        for (uint256 tokenId; tokenId < tokens.length; tokenId++) {
            _withdrawAllAndClaimResponse.tokenAmounts[tokenId] = _userTokenBalance(
                tokens[tokenId],
                recipient,
                biosAddress
            );
        }

        _withdrawAllAndClaimResponse.biosClaimed += IBiosEmitter(biosEmitterAddress).harvestAll(recipient);

        /// @notice Make sure to call `BiosEmitter.harvest(...)` before `UserPosition._withdraw(...)`, because BiosEmitter relies on the user balance state reported by the UserPositions contract.
        _withdrawAllAndClaimResponse.ethWithdrawn = _withdraw(
            recipient,
            tokens,
            _withdrawAllAndClaimResponse.tokenAmounts,
            withdrawWethAsEth
        );

        if (IEtherRewards(moduleMap.getModuleAddress(Modules.EtherRewards)).getUserEthRewards(recipient) > 0) {
            _withdrawAllAndClaimResponse.ethClaimed = _claimEthRewards(recipient, strategies);
        }
    }

    function withdraw(
        address recipient,
        address[] memory tokens,
        uint256[] memory amounts,
        bool withdrawWethAsEth
    ) external override whenNotPaused onlyController returns (uint256 ethWithdrawn) {
        require(recipient != address(0), "bad address");
        ethWithdrawn = _withdraw(recipient, tokens, amounts, withdrawWethAsEth);
    }

    /**
     *
     *
     *
     * getters
     *
     *
     *
     **/

    function totalTokenBalance(address asset) external view override returns (uint256) {
        IIntegrationMap integrationMap = IIntegrationMap(moduleMap.getModuleAddress(Modules.IntegrationMap));
        address biosAddress = integrationMap.getBiosTokenAddress();

        if (asset == biosAddress) return totalStrategyBalance(BIOS_STRATEGY_1155);
        else return _totalSupply[asset];
    }

    function userTokenBalance(address asset, address account) external view override returns (uint256) {
        IIntegrationMap integrationMap = IIntegrationMap(moduleMap.getModuleAddress(Modules.IntegrationMap));
        address biosAddress = integrationMap.getBiosTokenAddress();

        return _userTokenBalance(asset, account, biosAddress);
    }

    function _userTokenBalance(
        address asset,
        address account,
        address bios
    ) internal view returns (uint256) {
        if (asset == bios) {
            return userStrategyBalance(account, BIOS_STRATEGY_1155);
        } else {
            return _balances[asset][account];
        }
    }

    function totalStrategyBalance(uint256 strategyId) public view override returns (uint256) {
        return IStrategy1155(moduleMap.getModuleAddress(Modules.Strategy1155)).totalSupply(strategyId);
    }

    function userStrategyBalance(address account, uint256 strategyId) public view override returns (uint256) {
        return IStrategy1155(moduleMap.getModuleAddress(Modules.Strategy1155)).balanceOf(account, strategyId);
    }

    function userInterconnectBalance(address asset, address account) external view override returns (uint256) {
        return _interconnectBalances[asset][account];
    }

    function userDeployableBalance(address asset, address account) external view override returns (uint256) {
        IIntegrationMap integrationMap = IIntegrationMap(moduleMap.getModuleAddress(Modules.IntegrationMap));
        address biosAddress = integrationMap.getBiosTokenAddress();

        return _userTokenBalance(asset, account, biosAddress) + _interconnectBalances[asset][account];
    }

    /**
     *
     *
     *
     * interconnections
     *
     *
     *
     **/

    function _remoteStrategyExecution(
        uint256 strategyID,
        address user,
        address token,
        uint256 amount,
        bool enterStrat
    ) external override onlyController {
        if (enterStrat) {
            _enterStrategy(strategyID, user, amount);
            IStrategyMap(moduleMap.getModuleAddress(Modules.StrategyMap)).increaseStrategy(strategyID, token, amount);
        } else {
            _exitStrategy(strategyID, user, amount);
            IStrategyMap(moduleMap.getModuleAddress(Modules.StrategyMap)).decreaseStrategy(strategyID, amount);
        }
    }

    function updateUserTokenBalances(
        address[] calldata assets,
        address account,
        uint256[] calldata amounts,
        bool[] memory add
    ) external override onlyController {
        require(account != address(0), "bad address");

        require(assets.length == amounts.length, "UserPositions::updateUserTokenBalances: arrays must be equal length");
        for (uint256 i; i < assets.length; ++i) {
            uint256 currBal = _balances[assets[i]][account];
            require(
                0 != amounts[i],
                "UserPositions::updateUserTokenBalances: Must have a positive or negative number to change the balance"
            );
            uint256 newAvailableAmount;
            if (add[i]) {
                newAvailableAmount = currBal + amounts[i];
            } else {
                require(
                    amounts[i] <= currBal,
                    "UserPositions::updateUserTokenBalances: Amount to reduce balance must be no more than current balance"
                );
                newAvailableAmount = currBal - amounts[i];
            }
            _balances[assets[i]][account] = newAvailableAmount;
        }
    }

    function updateUserInterconnectBalances(
        address[] memory assets,
        address account,
        uint256[] memory amounts,
        bool[] memory add
    ) external override onlyController {
        require(account != address(0), "bad address");

        require(
            assets.length == amounts.length,
            "UserPositions::updateUserInterconnectBalances: arrays must be equal length"
        );
        for (uint256 i; i < assets.length; ++i) {
            uint256 currBal = _interconnectBalances[assets[i]][account];
            require(
                0 != amounts[i],
                "UserPositions::updateUserInterconnectBalances: Must have a positive or negative number to change the balance"
            );
            uint256 newAvailableAmount;
            if (add[i]) {
                newAvailableAmount = currBal + amounts[i];
            } else {
                require(
                    amounts[i] <= currBal,
                    "UserPositions::updateUserInterconnectBalances: Amount to reduce balance must be no more than current balance"
                );
                newAvailableAmount = currBal - amounts[i];
            }
            _interconnectBalances[assets[i]][account] = newAvailableAmount;
        }
    }

    /**
     *
     *
     * internal user cycle
     *
     *
     **/

    function _deposit(
        address depositor,
        address[] memory tokens,
        uint256[] memory amounts,
        uint256 ethAmount,
        bool isAirdrop
    ) private {
        IIntegrationMap integrationMap = IIntegrationMap(moduleMap.getModuleAddress(Modules.IntegrationMap));
        address biosAddress = integrationMap.getBiosTokenAddress();
        address biosEmitterAddress = biosAddress != address(0)
            ? moduleMap.getModuleAddress(Modules.BiosEmitter)
            : address(0);

        uint256[] memory actualAmounts = new uint256[](tokens.length);

        if (ethAmount > 0) {
            address wethAddress = integrationMap.getWethTokenAddress();

            // Update WETH balances
            _totalSupply[wethAddress] += ethAmount;
            _balances[wethAddress][depositor] += ethAmount;
        }

        for (uint256 tokenId; tokenId < tokens.length; tokenId++) {
            require(amounts[tokenId] > 0, "UserPositions::deposit: Deposit amount must be greater than zero");
            uint256 actualAmount;

            if (isAirdrop) {
                actualAmount = amounts[tokenId];
            } else {
                // Token must be accepting deposits. Airdrop checks in parent func for efficiency
                require(
                    integrationMap.getTokenAcceptingDeposits(tokens[tokenId]),
                    "UserPositions::deposit: This token is not accepting deposits"
                );
                // deposits the amount from user into the Kernel
                actualAmount = _transferIn(depositor, tokens[tokenId], amounts[tokenId]);
            }

            // IF BiosEmitter exists then record deposit in BiosEmitter so they can receive BIOS Rewards
            if (biosEmitterAddress != address(0)) {
                // If the token is eligible for BIOS Rewards
                if (IBiosEmitter(biosEmitterAddress).getEligibleToken(tokens[tokenId])) {
                    // External call: `deposit` does not actually deposit BIOS into BiosEmitter
                    // Master Chief is simply keeping track of reward distributions
                    /// @notice UserPosition State (Balance, etc.) must be updated after calling Deposit
                    IBiosEmitter(biosEmitterAddress).deposit(tokens[tokenId], actualAmount, depositor);
                }
            }

            actualAmounts[tokenId] = actualAmount;
            // BIOS gets eth rewards increased on deposit, not strategy
            if (tokens[tokenId] == biosAddress) {
                IStrategy1155(moduleMap.getModuleAddress(Modules.Strategy1155)).mint(
                    depositor,
                    BIOS_STRATEGY_1155,
                    actualAmount
                );
            } else {
                /// @notice WARNING!!! - This state change must happen at end of function. BiosEmitter is relying on an external call in
                /// _migrateUsersPosition, to sync the user's initial UserPositions balance, pre deposit.
                _totalSupply[tokens[tokenId]] += actualAmount;
                _balances[tokens[tokenId]][depositor] += actualAmount;
            }
        }

        emit Deposit(depositor, tokens, actualAmounts, ethAmount);
    }

    function _enterStrategy(
        uint256 _strategyId,
        address _user,
        uint256 _amount
    ) private {
        IStrategy1155 strategy1155 = IStrategy1155(moduleMap.getModuleAddress(Modules.Strategy1155));
        address underlying = getUnderlying(_strategyId);
        // we don't want to check the bios address when entering a strategy until a bios strategy is created
        require(_userTokenBalance(underlying, _user, address(0)) >= _amount, "insufficient funds");
        _balances[underlying][_user] -= _amount;

        strategy1155.mint(_user, _strategyId, _amount);

        emit EnterStrategy(_strategyId, _user, _amount);
    }

    function _claimEthRewards(address _recipient, uint256[] calldata _strategies) private returns (uint256 ethClaimed) {
        ethClaimed = IEtherRewards(moduleMap.getModuleAddress(Modules.EtherRewards)).claimEthRewards(
            _recipient,
            _strategies
        );
    }

    function _exitStrategy(
        uint256 _strategyId,
        address _user,
        uint256 _amount
    ) private {
        IStrategy1155 strategy1155 = IStrategy1155(moduleMap.getModuleAddress(Modules.Strategy1155));
        uint256 balance = strategy1155.balanceOf(_user, _strategyId);

        require(balance >= _amount, "insufficient funds");
        _balances[getUnderlying(_strategyId)][_user] += _amount;

        strategy1155.burn(_user, _strategyId, _amount);

        emit ExitStrategy(_strategyId, _user, _amount);
    }

    function _withdraw(
        address recipient,
        address[] memory tokens,
        uint256[] memory amounts,
        bool withdrawWethAsEth
    ) private returns (uint256 ethWithdrawn) {
        IIntegrationMap integrationMap = IIntegrationMap(moduleMap.getModuleAddress(Modules.IntegrationMap));
        address wethAddress = integrationMap.getWethTokenAddress();
        address biosAddress = integrationMap.getBiosTokenAddress();
        address biosEmitterAddress = moduleMap.getModuleAddress(Modules.BiosEmitter);

        require(
            tokens.length == amounts.length,
            "UserPositions::_withdraw: Tokens array length does not match amounts array length"
        );

        for (uint256 tokenId; tokenId < tokens.length; tokenId++) {
            if (amounts[tokenId] == 0) continue;
            require(
                integrationMap.getTokenAcceptingWithdrawals(tokens[tokenId]),
                "UserPositions::_withdraw: This token is not accepting withdrawals"
            );
            require(
                amounts[tokenId] <= _userTokenBalance(tokens[tokenId], recipient, biosAddress),
                "UserPositions::_withdraw: Withdraw amount exceeds user balance"
            );

            // Process user withdrawal amount management, and close out positions as needed to fund the withdrawal
            uint256 reserveBalance = _findMoney(
                tokens[tokenId],
                ISyntheticMap(moduleMap.getModuleAddress(Modules.SyntheticMap)).underlyingToSynthetic(tokens[tokenId]),
                amounts[tokenId]
            );
            uint256 actualTransferAmount;

            if (reserveBalance < amounts[tokenId]) {
                actualTransferAmount = reserveBalance;
            } else {
                actualTransferAmount = amounts[tokenId];
            }

            if (tokens[tokenId] == wethAddress && withdrawWethAsEth) {
                ethWithdrawn = amounts[tokenId];
            } else {
                // Amounts recovered from the integrations for the user was lower than requested, likely due to fees (see yearn).
                IERC20MetadataUpgradeable(tokens[tokenId]).safeTransferFrom(
                    moduleMap.getModuleAddress(Modules.Kernel),
                    recipient,
                    actualTransferAmount
                );
            }

            // Update BiosEmitter before updating any state
            if (biosEmitterAddress != address(0)) {
                if (IBiosEmitter(biosEmitterAddress).getEligibleToken(tokens[tokenId])) {
                    IBiosEmitter(biosEmitterAddress).withdraw(tokens[tokenId], actualTransferAmount, recipient);
                }
            }

            // BIOS gets eth rewards decreased on withdraw, not strategy
            if (tokens[tokenId] == biosAddress) {
                IStrategy1155(moduleMap.getModuleAddress(Modules.Strategy1155)).burn(
                    recipient,
                    BIOS_STRATEGY_1155,
                    actualTransferAmount
                );
            } else {
                // Update balances
                _balances[tokens[tokenId]][recipient] -= actualTransferAmount;
                _totalSupply[tokens[tokenId]] -= actualTransferAmount;
            }
        }
    }

    /**
     *
     *
     * help methods
     *
     *
     **/

    function abs(int256 val) private pure returns (uint256) {
        return uint256(val >= 0 ? val : -val);
    }

    function getUnderlying(uint256 _strategyId) private view returns (address) {
        return IStrategy1155(moduleMap.getModuleAddress(Modules.Strategy1155)).idToUnderlying(_strategyId);
    }

    function _transferIn(
        address from,
        address token,
        uint256 amount
    ) private returns (uint256 actualAmount) {
        address kernel = moduleMap.getModuleAddress(Modules.Kernel);

        IERC20MetadataUpgradeable erc20 = IERC20MetadataUpgradeable(token);
        // Get the balance before the transfer
        uint256 beforeBalance = erc20.balanceOf(kernel);

        // Transfer the tokens from the source to the Kernel
        erc20.safeTransferFrom(from, kernel, amount);

        // Get the balance after the transfer
        actualAmount = erc20.balanceOf(kernel) - beforeBalance;
    }

    function _findMoney(
        address _underlying,
        address _syntheticERC20,
        uint256 _desired
    ) private returns (uint256 finded_) {
        // 1: trying find free money on kernel balance
        address kernel = moduleMap.getModuleAddress(Modules.Kernel);
        finded_ = IERC20MetadataUpgradeable(_underlying).balanceOf(kernel);

        if (finded_ < _desired) {
            // 2: trying to find money in the synthetic pool
            ISwapManager swapM = ISwapManager(moduleMap.getModuleAddress(Modules.SwapManager));

            uint256 missingAmount = (_desired - finded_);
            uint256 m3d2AmountOut;
            {
                bool isPoolExist;
                // if syn pool in limit ratio, 1.5 * desired amount should not get too much slippage
                (isPoolExist, m3d2AmountOut) = swapM.getBestAmountOut(
                    _syntheticERC20,
                    _underlying,
                    ((_desired * 3) / 2)
                );
                if (!isPoolExist) return finded_;
            }

            uint256 amountIn = (missingAmount * ((_desired * 3) / 2)) / m3d2AmountOut;

            uint256 synBalance = ISyntheticERC20(_syntheticERC20).balanceOf(kernel);
            amountIn = amountIn > synBalance ? synBalance : amountIn;
            if (amountIn > synBalance) {
                amountIn = synBalance;
                missingAmount = (missingAmount * synBalance) / amountIn;
            }

            (uint32 ratioUnd, uint32 ratioSyn) = ISyntheticERC20(_syntheticERC20).getPoolLimit();
            // Trying to swap kernel's synthetic tokens for underlying tokens
            uint256 syntheticSpendedToSwap = swapM.gentleSwapExactIn(
                _syntheticERC20,
                _underlying,
                ratioSyn,
                ratioUnd,
                kernel,
                amountIn,
                missingAmount
            );
            uint256 underlyingReceived = IERC20MetadataUpgradeable(_underlying).balanceOf(kernel) - finded_;

            synBalance -= syntheticSpendedToSwap;
            finded_ += underlyingReceived;

            // Change underlying and strategy debt depending on received underlying and spended synthetic
            //
            // We accrue underlying debt when spend synthetic more, that get underlying from swap (always because of fee)
            // we will pay this debt in next deploy to synthetic pool (take debt amount from deposit and hold it for the next withdrawal)
            //
            // We accrue strategy debt if get any underlying amount from the synthetic pool
            // this debt will be payed by YieldManager::deploy() function
            // because then user exit from strategy we decrease deploy amount to corresponding strategy and when deploy
            // if we withdraw any amount from integrations, first we check, do we need to pay strategy debt, and if so
            // we will return debt amount back to synthetic pool
            ISyntheticERC20(_syntheticERC20).changePoolDebt(syntheticSpendedToSwap, underlyingReceived);
        }
    }

    function migrate(address asset, address[] calldata users) external onlyOwner {
        for (uint256 i; i < users.length; i++) {
            if (_balances[asset][users[i]] > _deployedBalances[users[i]][asset]) {
                _balances[asset][users[i]] -= _deployedBalances[users[i]][asset];
            } else {
                delete _balances[asset][users[i]];
            }
        }
    }
}
